ch etwa <strong>300 Blüten</strong> bestäuben und übernimmt zusammen mit den Wildbienen und anderen bestäubenden Insekten ca. <strong>80 bis 90 Prozent</strong> der Bestäubungsarbeit.</p>', '1', '', 0xa04090f6d94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:21:\"white-text dark-image\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', 'Mehr erfahren ...', '{{link_url::2}}', NULL, 0x613a323a7b693a303b733a313a2233223b693a313b733a313a2232223b7d, 0xa0409139d94c11e9bb5ee0d55edd9ad9, NULL, NULL, '', '');
