rten</strong> aus. Die Nistplätze der Wildbienen befinden sich vor allem <strong>unter der Erde</strong>, aber auch Totholz, Pflanzenstängel, leere Schneckenhäuser oder von Menschen gebaute Bienenhotels werden genutzt.</p>\n<p>Genau wie die Honigbienen haben auch die Wildbienen eine <strong>große Bedeutung</strong> für die Bestäubung von Bäumen, Blumen und Nutzpflanzen.</p>', '1', '', 0xa044effdd94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sticky-teaserbox\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 'ce_cthemes_teaserbox_fullheight', 'Mehr erfahren ...', 'Mehr erfahren ...', '{{link_url::2}}', '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', '', '', NULL, 0x613a313a7b693a303b733a323a223131223b7d, NULL, NULL, NULL, '', '');
