adtimker.</p>\n<p>Es ist nicht so, dass es in den Städten keinen geeigneten Lebensraum für Bienen gibt. Parkanlegen, Gärten, Alleen oder auch Balkonpflanzen können für genug Vielfalt und geeigneten Lebensraum sorgen. Zudem ist es in der Stadt durchschnittlich 2 bis 3 Grad wärmer als im Umland, was der Biene gute Voraussetzungen zum Leben schafft.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:17:\"center large-text\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', '', '', NULL, 0x613a313a7b693a303b733a313a2235223b7d, NULL, NULL, NULL, '', '');
