e nur für eine kurze Zeit blühen. Pestizide, der Klimawandel und natürliche Feinde, die teilweise aus anderen Regionen eingeschleppt wurden, bedrohen ebenfalls den Bestand der Bienen.</p>\n<p>Würde es keine Bienen mehr geben, hätte das große Folgen für die Umwelt, da sie für den größten Teil der Bestäubung der Pflanzen zuständig sind. Es würde nicht nur keinen Honig mehr geben, sondern es würde auch viel weniger Obst und Gemüse geben.</p>\n<p>Man kann den Bienen ganz einfach helfen, indem man bienenfreundliche Blumen anpflanzt und ihnen so genug Nahrung bietet oder auch Honig von örtlichen Imkern bezieht und sie damit unterstützt.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', '');
