sarbeit.</p>\n<p>Hummeln schaffen sogar rund <strong>1.000 Blüten</strong> an einem Tag. Während die Honigbiene bei kühleren Temperaturen noch ruht, ist die Wildbiene auch schon bei schlechteren Wetterbedingungen und kühleren Temperaturen unterwegs und beginnt mit der Bestäubung.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', '');
