Deutschland geht man von über 550 Arten aus. Die Nistplätze der Wildbienen befinden sich vor allem unter der Erde, aber auch Totholz, Pflanzenstängel, leere Schneckenhäuser oder von Menschen gebaute Bienenhotels werden genutzt.</p>\n<p>Genau wie die Honigbienen haben auch die Wildbienen eine große Bedeutung für die Bestäubung von Bäumen, Blumen und Nutzpflanzen.</p>\n<p>Während die Honigbiene in einem großen Volk mit vielen anderen Bienen in Bienenstöcken lebt, lebt die Wildbiene als Einzelgänger und nistet vor allem im Boden oder sucht sich Pflanzenhalme oder nutzt Fraßgänge von Käfern im Holz.</p>\n</div>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, 'column is-6-desktop', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', '');
