lüten am Tag bestäuben. Genau wie Honigbienen leben Hummeln nicht als Einzelgänger, sondern in einem Volk, das aber nur für kurze Zeit.</p>\n<p>Hummeln gehören zu den “Echten Bienen” und machen sich von März bis Mai auf die Suche nach einem geeigneten Nistplatz: z. B. Totholzhaufen, Steinplatten, Mäuselöcher oder auch Vogelnester oder Hausisolierungen.</p>\n<p>Sie sind besonders gute Bestäuber, da sie durch ihre lange Zunge und das so genannte Vibrationssammeln besonders gut tiefe Blüten bestäuben können.</p>\n</div>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, 'column is-6-desktop', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', '');
