dann erzeugt, wenn die Ernährung des Volkes und die Aufzucht der Brut gedeckt ist.</p>\n<p>Abhängig von der Art der Pflanzen, die die Bienen sammeln, hat der Honig verschiedene Eigenschaften. So ist Akazienhonig z. B. sehr hell und flüssig und andere Sorten wie der Rapshonig werden dagegen fest.</p>', '1', '', 0xa044f023d94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 'ce_cthemes_teaserbox_nature', 'Mehr erfahren ...', 'Mehr erfahren ...', '{{link_url::2}}', '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', '');
