leben in einem großen Volk, dass bis zu <strong>50.000 Mitglieder</strong> zählen kann und können nicht alleine überleben, da sie den sozialen Kontakt zu anderen Bienen benötigen. Das Volk besteht aus einer <strong>Königin</strong>, den <strong>Arbeitsbienen</strong> und <strong>Drohnen</strong>. Während die Arbeiterinnen für das Sammeln, Putzen und Wache halten zuständig sind, besteht die Aufgabe der Drohnen nur darin eine Königin zu befruchten und damit das Überleben des Volkes und der Nachkommen zu sichern.</p>', '1', '', 0xa044efbbd94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sticky-teaserbox\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 'ce_cthemes_teaserbox_fullheight', 'Mehr erfahren ...', 'Mehr erfahren ...', '{{link_url::2}}', '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, '', '', '', '', '', NULL, 0x613a313a7b693a303b733a323a223131223b7d, NULL, NULL, NULL, '', '');
