u 50.000 Mitglieder zählen kann und können nicht alleine überleben, da sie den sozialen Kontakt zu anderen Bienen benötigen. Das Volk besteht aus einer Königin, den Arbeitsbienen und Drohnen. Während die Arbeiterinnen für das Sammeln, Putzen und Wache halten zuständig sind, besteht die Aufgabe der Drohnen nur darin eine Königin zu befruchten und damit das Überleben des Volkes und der Nachkommen zu sichern.</p>\n<p>Die Honigbiene kann täglich etwa 300 Blüten bestäuben und übernimmt zusammen mit den Wildbienen und anderen bestäubenden Insekten ca. 80 bis 90 Prozent der Bestäubungsarbeit.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:10:\"large-text\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, '', NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', NULL, NULL, NULL, 'has-text-centered', '', '', '', '', NULL, 0x613a313a7b693a303b733a313a2235223b7d, NULL, NULL, NULL, '', '');
