INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(3, 1, 1568727285, 'Wildbienen sind Einzelgänger', 'wildbienen-sind-einzelgaenger', 1, 1568030400, 1568030400, 'Wissenswertes', '<p>Alleine in Europa gibt es mehr als 2.500 unterschiedliche Wildbienenarten, in Deutschland geht man von über 550 Arten aus.</p>', '1', '', 0xa044effdd94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(4, 1, 1568727296, 'Hummeln sind besonders gute Bestäuber', 'hummeln-sind-besonders-gute-bestaeuber', 1, 1568030400, 1568030400, 'Wissenswertes', '<p>Hummeln können im Vergleich zu Honigbienen mehr als dreimal so viel Blüten am Tag bestäuben. Genau wie Honigbienen leben Hummeln nicht als Einzelgänger, sondern in einem Volk, das aber nur für kurze Zeit.</p>', '1', '', 0xa044f01ed94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(5, 1, 1568727277, 'Was kann man gegen das Bienensterben tun?', 'was-kann-man-gegen-das-bienensterben-tun', 1, 1568030460, 1568030460, 'Tipps', '<p>Bienen müssen geschützt werden, da es ohne diese fleißigen Helfer viele Dinge gar nicht mehr geben würden.</p>', '1', '', 0xa0409139d94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(6, 1, 1568727249, 'Bienenhonig', 'bienenhonig', 1, 1568030520, 1568030520, 'Ernährung', '<p>Der Honig, der aus dem Nektar von Blüten und aus Honigtau besteht, ist die Nahrungsreserve der Bienen und wird nur dann erzeugt, wenn die Ernährung des Volkes und die Aufzucht der Brut gedeckt ist.</p>', '1', '', 0xa044f023d94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(7, 1, 1568727258, '80 bis 90 Prozent der Bestäubungsarbeit', '80-bis-90-prozent-der-bestaeubungsarbeit', 1, 1568030520, 1568030520, 'Wissenswertes', '<p>Die Honigbiene kann täglich etwa 300 Blüten bestäuben und übernimmt zusammen mit den Wildbienen und anderen bestäubenden Insekten ca. 80 bis 90 Prozent der Bestäubungsarbeit.</p>', '1', '', 0xa0409142d94c11e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(8, 2, 1568110535, 'Bienen schützen', 'bienen-schuetzen-2', 1, 1568110440, 1568110440, 'Wichtig', '<p>Es gibt viele Faktoren, die für das Bienensterben verantwortlich sind. Zum einen finden Bienen nicht mehr genug Nahrung, da in der Landschaft immer mehr Monokulturen angebaut werden, die nur für eine kurze Zeit blühen. Pestizide, der Klimawandel und natürliche Feinde, die teilweise aus anderen Regionen eingeschleppt wurden, bedrohen ebenfalls den Bestand der Bienen.</p>', '', '', 0xe7dab66cc8a811e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '', NULL);
