INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`, `cssStyleSelector`) VALUES(194, 3, 1569235323, 'Heute ging es wieder mal auf eine kleine Lost-Place-Tour mit Mystik Moments Fotografie Meißen und Sachsens verlassene Schönheiten. Ein Zwischenstopp war dieser Gasthof, ein richtig tolles Gebäude, allerdings leider nicht mehr zu retten. ', '', 0, 1564942126, 1564942126, '', 'Heute ging es wieder mal auf eine kleine Lost-Place-Tour mit Mystik Moments Fotografie Meißen und Sachsens verlassene Schönheiten. Ein Zwischenstopp war dieser Gasthof, ein richtig tolles Gebäude, allerdings leider nicht mehr zu retten. <br><br>Der Gasthof hat einen großen Saal, dessen Decke bereits vor langer Zeit eingestürzt ist und auch bereits 1959 geschlossen wurde. Nachdem der Gaststättenbetrieb 1965 ebenfalls eingestellt wurde, wurde das Gebäude noch eine Zeit lang durch den Großhandel und für Lagerzwecke genutzt. <br><br>Hinein kommt man nicht mehr, da es komplett eingezäunt wurde. Einen kleinen Blick kann man aber von außen noch in den Saal werfen, zumindest die verzierten Säulen kann man noch erkennen, ansonsten ist alles eingestürzt und bewachsen.', '1', '', 0x9c1ba637da1c11e9bb5ee0d55edd9ad9, '', '', '', '', '', '', '', 'above', '', NULL, 'external', 0, 0, 'https://www.facebook.com/624116000977940/posts/2485386918184163/', '1', '', '', '', '1', '', '', NULL);
